using System;
using System.Collections;
using PX.Common;
using PX.Data;
using PX.SM;
using PX.Objects;
using PX.Objects.CR;
using PX.Objects.CR.DAC;
using System.Collections.Generic;

namespace PX.Objects.CR
{
    public class BusinessAccountMaint_Extension : PXGraphExtension<BusinessAccountMaint>
    {
        public PXAction<BAccount> CallPhone1;
        [PXButton(CommitChanges = true)]
        [PXUIField(DisplayName = "Call")]
        protected void callPhone1()
        {
            string phone = Base.DefContact.Current.Phone1;
            if(!string.IsNullOrEmpty(phone) && phone.Length > 0) 
            {
                string url = string.Format("tel:+1{0}", phone.Trim());
                throw new PXRedirectToUrlException(url, PXBaseRedirectException.WindowMode.New, "");
            }
        }

        public PXAction<BAccount> CallPhone2;
        [PXButton(CommitChanges = true)]
        [PXUIField(DisplayName = "Call")]
        protected void callPhone2()
        {
            string phone = Base.DefContact.Current.Phone2;
            if(!string.IsNullOrEmpty(phone) && phone.Length > 0)
            {
                string url = string.Format("tel:+1{0}", phone.Trim());
                throw new PXRedirectToUrlException(url, PXBaseRedirectException.WindowMode.New, "");
            }
        }
    }
}

